import React from 'react';
import { getUser, removeUserSession } from './Utils/Common';

function DashboardHeader(){
    return (
        <div class="bg-gray-200">
                <div class="max-w-screen-xl mx-auto py-12 px-4 sm:px-6 lg:py-16 lg:px-8 lg:flex lg:items-center lg:justify-between">
                    <h2 class="text-3xl leading-9 font-extrabold tracking-tight text-gray-900 sm:text-4xl sm:leading-10" >
                    Welcome Back, 
                    <br />
                        <span class="text-indigo-600"> {user} </span>
                    </h2>
                    <div class="mt-8 flex lg:flex-shrink-0 lg:mt-0">
                    <div class="inline-flex rounded-md shadow">
                        <a href="#" class="inline-flex items-center justify-center px-5 py-3 border border-transparent text-base leading-6 font-medium rounded-md text-white bg-indigo-600 hover:bg-indigo-500 focus:outline-none focus:shadow-outline transition duration-150 ease-in-out">
                        Get started
                        </a>
                    </div>
                    <div class="ml-3 inline-flex rounded-md shadow">
                        <a onClick={handleLogout} class="inline-flex items-center justify-center px-5 py-3 border border-transparent text-base leading-6 font-medium rounded-md text-indigo-600 bg-white hover:text-indigo-500 focus:outline-none focus:shadow-outline transition duration-150 ease-in-out">
                        Logout
                        </a>
                    </div>
                    </div>
                </div>
        </div>
    );
}
function Dashboard(props) {

    const user = getUser();

    // handle click event of logout button
    const handleLogout = () => {    
        removeUserSession();
        props.history.push('/login');
    }

    return (
        <div>
            <DashboardHeader />
        </div>
    );
}

export default Dashboard;
